import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HeaderComponent } from './core/components/header/header.component';
import { SidebarComponent } from './core/components/sidebar/sidebar.component';
import { TopbarComponent } from './core/components/topbar/topbar.component';
import { ServiceRequestsComponent } from './core/components/service-requests/service-requests.component';
// import { TableOfServiceComponent } from './core/components/service-requests/table/table.component';
import { FormsModule } from '@angular/forms';
import { UsersComponent } from './core/components/users/users.component';
import { TableComponent } from './core/components/users/table/table.component';
import { TitlePageComponent } from './core/components/users/title-page/title-page.component';
import { SectionThreeComponent } from './core/components/users/section-three/section-three.component';
import { TitleOfRequestsComponent } from './core/components/service-requests/title-of-requests/title-of-requests.component';
import { RequestActionComponent } from './core/components/service-requests/request-action/request-action.component';
import { RequestTableComponent } from './core/components/service-requests/request-table/request-table.component';
import { RequestTitleComponent } from './core/components/service-requests/request-title/request-title.component';


@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    SidebarComponent,
    TopbarComponent,
    ServiceRequestsComponent,
    UsersComponent,
    TableComponent,
    TitlePageComponent,
    SectionThreeComponent,
    TitleOfRequestsComponent,
    RequestActionComponent,
    RequestTableComponent,
    RequestTitleComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
